ains. It will be served with gravy.',1002,'2016-01-08 17:59:29',NULL,1),(210,10009,1000054,68,'Super Basmati Rice','Kohinoor Basmati Rice-Super.',1002,'2016-01-08 18:03:22',NULL,1),(211,10009,1000054,69,'Aqua Mist Basmati Rice','Radikal Aqua Mist is a range of premium naturally aged basmati rice. It provides enthralling aroma, superfine slender grains, divine flavor and impeccably soft texture. It has everything to give you a pure royal treat and to delight your senses, your soul.',1002,'2016-01-09 02:41:19',NULL,1),(212,10009,1000054,71,'Mini Mogra','India Gate Basmati Rice Mini Mogra is cultivated in the Terai region of the North-Western Himalaya. This high quality harvest is aged in a state-of-the-art rice milling plant.India Gate is a well reputed company known for providing variety range of product with the guarantee of quality pus healthy. India Gate Basmati Mini Mogra gives you the long and tasty basmati rice which makes it a healthy to have on regular basis.',1002,'2016-01-09 02:59:51',NULL,1),(213,10009,1000054,71,'Mogra Basmati Rice','India Gate Basmati Rice Mogra is cultivated in the Terai region of the North-Western Himalaya. This high quality harvest is aged in a state-of-the-art rice milling plant. Mogra rice is famous for its great taste and flavour all over the world. This rice has a unique nutty flavour that enhances its aroma when you cook this rice. This rice is usually long grained and has pure white shade. The rice is such rich in taste that each dish will taste different and yet the flavour of the rice will sustain for long.India Gate Mogra Basmati Rice with its taste aroma long grain and pristine white lustre are sure to make you go wow! The special aroma and flavour will adorn your meal and its splendid taste is sure to melt in your mouth.',1002,'2016-01-09 03:05:25',NULL,1),(214,10009,1000054,71,'Mini Dubar Basmati Rice','India gate basmati rice mini dubar can be exclusively recognized by its aroma and length of the grains. India Gate is known in the industry for its quality.India Gate Basmati rice Mini Dubar originates from the heart of basmati growing land of india-the Terai region of North Western Himalaya.The highest quality harvest of the region is tested,procured and then sent for aging for a minimum period of one year in the most conducive environment of the company storage.',1002,'2016-01-09 03:17:18',NULL,1),(215,10009,1000054,71,'Feast Rozzana Basmati Rice','India Gate Feast Rozzana Basmati Rice are perfectly suitable for using in preparing several rice items. The long grain and aromatic rice offers you a big time relish able treat to yourselves.When the World thinks of Basmati, it thinks of India and India Gate Basmati rice. India Gate Basmati Rice will be an integral part of every quality rice recipe and on your platter to relish.',1002,'2016-01-09 03:21:45',NULL,1),(216,10009,1000054,71,'Classic Basmati Rice','India gate Basmati rice being a rich and unforgettable blend of tradition and royalty optimizes the spirit of a unique and incredible India. India Gate brings the finest of basmati rice to the global palate by giving unbridled joy to the faces of millions of consumers worldwide. India Gate Basmati as no other rice in the world has these characteristics in combination. It has an umforgetable aroma and taste that will linger in your mind forever.',1002,'2016-01-09 03:25:42',NULL,1),(217,10009,1000054,72,'Basmati Rozzana Super Rice','Enjoy the original taste and aroma of pure basmati everyday.',1002,'2016-01-09 03:31:25',NULL,1),(218,10009,1000054,72,'Biryani Basmati Rice','The signature of an authentic Biryani is the length of the rice grain. Every single grain of Daawat Biryani Basmati Rice elongates to 18-24 mm when cooked.Perfect for gifting at various occasions like Marriage, Birthday or other occasions.',1002,'2016-01-09 03:33:58',NULL,1),(219,10009,1000054,72,'Brown Basmati Rice','Daawat brown basmati rice is a great option for a delicious, nutritious and healthy quick cooking rice meal. Rich in fibre and natural goodness and also has delicious nutty flavour. It is processed with unique hydration enhancement technology which retains all the essential nutrients, making Daawat brown rice Indias only quick cooking brown rice It has vital health benefits and tastes much better than regular brown rice.',1002,'2016-01-09 03:35:50',NULL,1),(220,10009,1000054,72,'Dubar Basmati Rice','Dabur Basmati Rice is apt for every day consumption, all thanks to its great taste and aroma. Bring it home for preparing lip smacking biryanis and pulao.',1002,'2016-01-09 04:07:11',NULL,1),(221,10009,1000054,72,'Pulav Basmati Rice','A dish of mysterious, ancient origins that has found its way all over the world, authentic Pulav is characterized by the slender nature of its lustrous grains.Daawat Pulav Basmati Rice is apt for anything from simple Peas Pulav to exotic, Persian recipes.',1002,'2016-01-09 04:39:25',NULL,1),(222,10009,1000054,72,'Rozana Gold Basmati Rice','Daawat Rozana Basmati Rice with its aroma, taste, long grain and pure white luster lets you prepare all meal special.',1002,'2016-01-09 04:44:00',NULL,1),(223,10009,1000054,72,'Rozana Mini Basmati Rice','Daawat rozana mini basmati rice is derived from the world famous traditional basmati rice grown by the farmers in the foothills of the himalya,nourished with pristine river water,dedicately complying international organic food standards .its exquisitely lustrous slender grain ,devine aroma, charismatic nutty flavour fascinates the taste buds of food connoisseurs across the world.',1002,'2016-01-09 04:46:52',NULL,1),(224,10009,1000054,72,'Razana Gini 70 Basmati Rice','Daawat Rozana Basmati Rice With Its Aroma, Taste, Long Grain And Pure White Luster Lets You Prepare All Meal Special.Daawat Rozana Rice Make those lovely sumptuous pulavs or the rich and multi-faceted biryanis or even the simple yet elegant gini rice to accompany your dal and sabzi. Engage your senses in this aromatic and premium product. During the process of rice milling the grain tends to break, these broken grains are separated and packed accordingly on the basis of their size.',1002,'2016-01-09 04:49:25',NULL,1),(225,10009,1000054,72,'Razana Niki 40 Basmati Rice','During the process of rice milling the grain tends to break, these broken grains are separated and packed accordingly on the basis of their size. Although Rozana Gold is a head grain which has all the goodness of pure Basmati but is not long enough to make it to the premium category, all other variants are broken and thus named on the basis of the grain length.',1002,'2016-01-09 04:53:04',NULL,1),(226,10009,1000054,72,'Traditional Basmati Rice','A traditional favourite, this upper special variety is grown in the lush green paddy fields in the foothills of the Himalayas, which is the reason for its unmatched aroma and flavour.Each grain doubles in size on cooking to give remarkably long and fluffy rice. Its ideal for a la carte dishes. Daawat Basmati rice is just perfect - length exceeding 7.5 mm, perfectly tapered ends, uniformly long grain, pristine white lustre and appetizing aroma.',1002,'2016-01-09 05:00:34',NULL,1),(227,10009,1000054,68,'Mini Dubar Basmati Rice','This rice is formulated in stringent compliance with the industry norms and standards.',1002,'2016-01-09 13:38:59',NULL,1),(230,10009,1000054,68,'Mini Mogra Basmati Rice','This rice is formulated in stringent compliance with the industry norms and standards.',1002,'2016-01-09 13:42:37',NULL,1),(231,10006,1000049,56,'Black Pepper','Catch Black Pepper Powder is an organic spice adds the aromatic touch and flavor to all food items. This Pepper powder has a pointed, hot and biting savor. It is used along with other spices too to enhance the flavor and taste. Its a warming flavor and disinfected & free from moisture and highly valued among our clients for their rich aroma and musty flavor.',1002,'2016-01-09 14:32:32',NULL,1),(232,10006,1000048,56,'Kasuri Methi Whole','Kasuri Methi is an exotic Indian spice that contains mashed leaves of fenugreek. With a tinge of this masala you can add more flavour and aroma to your curries or other vegetable dishes.',1002,'2016-01-09 14:47:13',NULL,1),(233,10006,1000049,64,'Kasuri Methi','Everest Kasuri Methi is one such product. Everest has been in India for over 45 years, and has shaped the preference for branded spice in a country where homemade blends were the norm since time immemorial. It is estimated that over 20 million households regularly use Everest spices that are available in around 400,000 outlets in more than 1000 towns across India. Everest Kasuri Methi is one such product. Everest has been in India for over 45 years, and has shaped the preference for branded spice in a country where homemade blends were the norm since time immemorial. It is estimated that over 20 million households regularly use Everest spices that are available in around 400,000 outlets in more than 1000 towns across India.',1002,'2016-01-09 14:54:07',NULL,1),(234,10006,1000049,56,'Kashmeri Mirch Powder','Catch kashmiri Chilli Powder is one of the main spice in Indian cuisines and in other parts of the world, We are manufacturing best quality chilli powder in our highly equipped plant near Pithampur Industrial Area for serving customers situated at different parts of the world.Red Chilly Powder to our clients that are hygienically processed using high quality and pure chillies. This powder is widely used by our clients for the preparation of different types of dishes and cuisines.',1002,'2016-01-09 15:09:52',NULL,1),(235,10006,1000049,56,'Garam Masala','The soul of Indian cuisine Garam Masala is a spice mix of black and white peppercorns cloves cinnamon nutmeg and bay leaf. This ground spice mix is an instant seasoning agent that is added while cooking.garam masala powder is a matter of personal taste and liking, some like it hot, strong and pungent, while some like the mild simple garam masala recipe like the one posted earlier which is best for every day cooking and is suitable to all including kids without leaving us dehydrated.',1002,'2016-01-09 15:16:27',NULL,1),(236,10006,1000049,64,'Black Pepper Powder','Everest Black Pepper Powder to enhance the taste of your dish. Famously known as ?black gold? and one of the oldest spices in the world, pepper is surely an exception and does a lot more than just adding flavour to your food. Apart from giving distinctive taste and aroma, this flavouring agent is rich in vitamins and minerals and also helps in preventing diseases, thus keeping you healthy and hearty.',1002,'2016-01-09 15:21:26',NULL,1),(237,10027,1000069,73,'MANGO MAKES 32 GLASS','',1002,'2016-01-10 06:34:28',NULL,1),(238,10043,1000014,74,'Bathroom Cleaner','Apply Neat for Periodic Cleaning (Once in 7 Days) Apply on surface and leave in for 30 min.For Daily Cleaning Dilute 50ml solution of Liquid in 500ml water in bottle. Apply on surface and leave in for 30 min.For surface of Tiles, Faucets, Glass, Sinks and Toilets to remove hard water Stains & Sanitization. Rinse well.',1003,'2016-01-10 16:56:17',NULL,1),(239,10043,1000013,74,'Glass Cleaner','Dilute 50 ml in 500 ml water in a bottle & gently mix.Sprays on surface from a distance of 15 cm and wipe with a dry & clean cloth to achieve a clean, shiny & smear free finish.',1003,'2016-01-10 17:07:38',NULL,1),(240,10043,1000115,74,'Grease Remover','Apply Neat on Stubborn grease / oil stains: Leave in for 10-15 minutes on surface to remove grease. Proceed for wash.\r\nFor Daily / Economical Cleaning: DILUTE 10 ml in 1 Ltr. Water in a bottle & gently mix.\r\nApply on surface and proceed for wash.',1003,'2016-01-10 17:20:54',NULL,1),(241,10043,1000115,74,'Dishwashing Liquid','Dilute Before Use: Dilute 200 ml concentrated solution of Liquid in 200 ml water.\r\nFor Heavy Grease / Daily Use: Squeeze Few Drops of Solution on Sponge of in water to clean heavy greasy pots, pans & utensils. Rinse well.',1003,'2016-01-10 17:24:01',NULL,1),(242,10043,1000012,74,'Surface Cleaner','Add 5 ml solution of liquid in a 8 Litter bucket of water and mix gently.\r\nFor cleaning floors, walls, washing, textiles, scrubbing. No need to rinse.',1003,'2016-01-10 17:26:24',NULL,1),(243,10044,1000018,74,'Prewash Stain Remover','For Tough Stains: Apply Neat directly on the stain of dry clothes and leave in for 15-20 minutes only.\r\nScrub gently under water and proceed for the laundry.\r\nFor Prewash Washing Machine. Add 10 ml per wash of 5 kg (30-45 Ltrs Machine) dry clothes.\r\nFor Hand Wash. Add 10 ml liquid in 8 liter water, shake and soak the clothes for few minutes.',1003,'2016-01-10 17:32:40',NULL,1),(244,10044,1000018,74,'Laundry Detergent with Conditioner','For Washing Machine: For Top & Front Load Washing Machine Add 10ml Liquid for washing 5kg dry load in washing machine (30-45 litters).\r\nIncrease proportionately on higher load.\r\nFor Hand Wash: Add 10 ml liquid in 8 litter water. Shake and soak the cloathes for few minutes\r\nWash as usual.',1003,'2016-01-10 17:37:06',NULL,1),(245,10004,1000039,75,'OLIVE OIL','',1003,'2016-01-11 02:50:39',NULL,1),(246,10004,1000040,76,'RICE BRAN OIL','',1003,'2016-01-13 01:22:48',NULL,1),(247,10004,1000040,76,'ZAITOON BLENDED OIL','',1003,'2016-01-13 01:22:48',NULL,1),(248,10005,1000044,55,'Salt','',1002,'2016-01-13 01:43:08',NULL,1),(249,10017,1000057,77,'Bikaneri Bhujia Namkeen','Bhikharam Bikaneri Bhujia',1002,'2016-01-16 15:29:01',NULL,1),(250,10017,1000057,77,'Aloo Bhujia Namkeen','Bhikharam Aloo Bhujia Namkeen',1002,'2016-01-16 15:32:47',NULL,1),(251,10017,1000057,77,'Bhel Puri','Bhikharam Bhel Puri',1002,'2016-01-16 15:43:54',NULL,1),(252,10017,1000057,77,'Kachori','Bhikharam Kachori',1002,'2016-01-16 15:57:44',NULL,1),(253,10017,1000057,77,'Maida Kaju','INGREDIENTS: Wheat Fine Flour, Carom Seeds, Iodised Salt, Edible Vegetable Oil, Spices and Condiments.',1002,'2016-01-16 16:32:02',NULL,1),(254,10017,1000057,77,'Methi Mathari','Bhikharam Methi Mathari',1002,'20